import React from "react";

export default function Navbar(props) {
  return (
    <div className="navbar">
      <span>Buscar personaje: </span>
      <input
        value={props.value}
        onChange={(e) => props.onChange(e.target.value)}
        className="searchbar"
      />
    </div>
  );
}
